import './App.css';
import React from 'react';

import Checkviz from './components/Checkviz';
import Explorer from './components/Explorer';

import Select from '@material-ui/core/Select';

const App = (props) => {
  // defaults
  let datasetList = [
    "mnist_sampled_2",
    "fmnist_sampled_2",
    "kmnist_sampled_2"
  ];

  let method = "tsne";
  let dataset = "mnist_sampled_2";
  let isLabel = true;
  let showMissing = true;
  let showFalse = true;
  let radius = 2;
  let stroke = 5;

  return (
    <div id="App-wrapper">
      <div id="App-header">
        <div id="App-title">CheckCluster - Explaining the Cluster Reliability of Multidimensional Projections</div>
      </div>
      <div className="App-container">
        <div className="App-sidebar">
          Select dataset
          <Select
            id={"datasetSelection"}
            value={dataset}
            onChange={(event) => dataset = event.target.value}
            style={{ width: "90px", fontSize: "12px" }}
            native
          >
            {datasetList.map((d, i) => (
              <option key={i} value={d} >
                {d}
              </option>
            ))}
          </Select>
        </div>
        <div className="App-main">
          {/* <Checkviz
            method="tsne"
            dataset="mnist_sampled_50"
            isLabel={true}
            radius={5}
          /> */}
          <Explorer
            method={"tsne"}
            dataset={"mnist_sampled_2"}
            isLabel={true}
            showMissing={true}
            showFalse={true}
            radius={2}
            stroke={5}
          />
        </div>
      </div>
    </div>
  );
}

export default App;
